import style from "./Card.module.css";

export default function Card({onClose, name, status, species, gender, origin, image}) {
   return (
      <div className={style.container} style={{ backgroundImage: `url(${props.backgroundImage})` }}>
         <button className={style.button}onClick={onClose}>X</button>
         <h2 className={style.h2}>{name}</h2>
         <h2 className={style.h2}>{status}</h2>
         <h2 className={style.h2}>{species}</h2>
         <h2 className={style.h2}>{gender}</h2>
         <h2 className={style.h2}>{origin.name}</h2>
         <img src={image} alt='Not Found' />
      </div>
   );
}
